import React from "react";
import fetch from "./Fetches";

class App extends React.Component {
  componentDidMount() {
    this.fetchData();
  }
  fetchData = async () => {
    let a = await fetch();
    console.log(
      a.forEach(doc => {
        console.log(`${doc.id} => ${doc.data()}`);
      })
    );
  };
  render() {
    return <div>HI</div>;
  }
}

export default App;
